 Bupleurum is a large genus of annual or perennial herbs or woody shrubs, with about 190 species, belonging to the family Apiaceae. Their compound umbels of small flowers are adorned with bracteoles that are sometimes large and may play a role in attracting pollinators. Rare among the Apiaceae are the simple leaves, bracts (if present), and bracteoles. The genus is almost exclusively native in the Old World Northern Hemisphere, with one species native to North America and one species native to southern Africa.
